import React, { useEffect } from 'react';
import { getData } from '../actions/actions';

const Home = () => {
  useEffect =
    (() => {
      getData();
    },
    []);
  return (
    <div style={{ margin: 30 }}>
      <div>
        <h1>Home</h1>
      </div>
    </div>
  );
};

export default Home;
